import React from 'react';
import './Navbar.scss';

const Navbar: React.FC = () => {
    return (
        <nav className="navbar">
            <div className="navbar-container">
                <a className="navbar-brand" href="/">
                    Trainer Management System
                </a>
            </div>
        </nav>
    );
};

export default Navbar;
